import {useSelector,useDispatch} from 'react-redux'
import axios from 'axios'
export default function Profil({userName}) {

const api = 'https://randomuser.me/api/'
//const api = "https://character-database.becode.xyz/characters";
const  getinformation = () =>
axios.get(api).then(res => {
    console.log("ici",res.data.results[0].name.first);
    return res.data.results[0].name.first
})

    const dispatch = useDispatch()
    const {name, imageProfil} = useSelector(state=> ({...state.profilReducer}))
    const charger = ()=> {
        dispatch({
            type:'LOAD',
            name : 'caca'
        })
    }
    return (
        <div>
            <header>
                <h1>Profil de : {userName}</h1>
            </header>
            <p>{name}</p>
            <button onClick={charger}>Load</button>
            <img src = {imageProfil}/>
            <div>
                <button> Ajoutez un Lien </button>
                <FormAddLinks />
            </div>
        </div>
    )
}
